  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:33.054918\",\n\t\"name\": \"rice-lake-national-wildlife-refuge-fiscal-year-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  and Mille Lacs National Wildlife Refuges outlines Refuge accomplishments during
  the 2001 fiscal year. The report begins with an introduction to the Refuges. Highlights
  and weather conditions are summarized for the year. Information about monitoring
  and studies- including surveys and censuses and studies and investigations- is provided
  next. Habitat restoration and management projects are also covered; activities include
  wetland restoration, water level management, moist soil management, mowing/haying/grazing,
  farming, and prescribed burning. Fish and wildlife management are discussed next
  with emphasis on reintroductions, nest structures, and animal control. Coordination
  activities, such as interagency coordination, tribal coordination, and cooperative
  activities, are outlined. The resource protection section provides an update on
  law enforcement, wildfire preparedness, permits, and contaminant investigation.
  Information about public education and recreation is given including visitor services
  and outreach. Finally, comprehensive management planning and general administration
  are discussed in the Refuge planning and administration section. Newspaper articles
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
